import Button from 'react-bootstrap/Button';
import ProgressBar from 'react-bootstrap/ProgressBar';
import 'bootstrap/dist/css/bootstrap.min.css';

const Header = () => {


    return (   
        <div>
                <Button id='LoginButt' href="./login">Login</Button>
                <ProgressBar now={60} />
        </div>
    )
  };

  
  export default Header;
